import React from 'react';
import { Row, Col, Image } from 'antd';
const Product = () => {
  return (
    <Row>
      <Col style={{ width: 477 }}>
        <div
          style={{
            border: '1px solid #D1D5DB',
            display: 'flex',
            justifyContent: 'center'
          }}
        >
          <Image
            src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
            width={377}
            style={{ marginTop: 72 }}
          />
          <p>Iphone X</p>
        </div>
      </Col>
      <Col style={{ width: 477 }}>col-6</Col>
      <Col style={{ width: 477 }}>col-6</Col>
      <Col style={{ width: 477 }}>col-6</Col>
    </Row>
  );
};

export default Product;
